import { Redirect, Route, RouteComponentProps } from "react-router-dom";
import { IonRouterOutlet } from "@ionic/react";
import React from "react";

import Dashboard from "./Dashboard/Dashboard";
import Agents from "./Agents/Agents";
import Complexes from "./Complexes/Complexes";
import Packages from "./Packages/Packages";
import Promotions from "./Promotions/Promotions";
import SignIn from "./SignIn/SignIn";
import SignUp from "./SignUp/SignUp";
import Calendar from "./Calendar/Calendar";
import Profile from "./Profile/Profile";
import AgentDetails from "./Agents/AgentDetails/AgentDetails";
import AddAgent from "./Agents/AddAgent/AddAgent"

const Router: React.FC<RouteComponentProps> = ({ match }) => (
  <IonRouterOutlet id="main">
    <Route path={match.url} exact={true}>
      <Redirect to="/signIn" />
    </Route>
    <Route path="/dashboard" exact={true}>
      <Dashboard />
    </Route>
    <Route path="/calendar" exact={true}>
      <Calendar />
    </Route>
    <Route path="/agents" exact={true}>
      <Agents />
    </Route>
    <Route path="/agentdetails/:name" exact={true}>
      <AgentDetails />
      </Route>
      <Route path="/addAgent" exact={true}>
      <AddAgent/>
    </Route>
    <Route path="/complexes" exact={true}>
      <Complexes />
    </Route>
    <Route path="/packages" exact={true}>
      <Packages />
    </Route>
    <Route path="/promotions" exact={true}>
      <Promotions />
    </Route>
    <Route path="/profile" exact={true}>
      <Profile />
    </Route>
    <Route path="/signIn" exact={true}>
      <SignIn />
    </Route>
    <Route path="/signUp" exact={true}>
      <SignUp />
    </Route>
  </IonRouterOutlet>
);

export default Router;
